import React from "react";
import ReactDOM from "react-dom";
import SectionHeader from "./SectionHeader";
import Service from "./Service";
class Services extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      icons: [
        "fas fa-phone-square-alt",
        "fas fa-school",
        "fas fa-sms",
        "fas fa-coffee",
        "fas fa-user-friends",
        "fas fa-child",
        "fab fa-elementor",
      ],
      name: [
        "Say Hi via phone number",
        "Find homies at the same university",
        "Messengers - saviors",
        "Meet up and work",
        "Who's your babysitter ?",
        "Tutor is right here to save the day",
      ],
      describe: [
        "This service is use your phone number and your request to find who is the most suitable ones to match with you. After thst, we'll give you guys opponent's phone number. The rest is yours",
      ],
    };
  }
  render() {
    return (
      <div style={{ backgroundColor: "#f5f8fd" }}>
        <div className="container">
          <SectionHeader
            headerName="Our services"
            headerDescribe="Here are our services - Let's find which one is the most suitable one for you"
          />
          <div className="row">
            <Service />
            <Service />
            <Service />
            <Service />
            <Service />
            <Service />
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
